0"><tbody><tr style="height:14pt"><td rowspan="3" style="width:48pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p style="text-indent: 0pt;text-align: left;"><br></p><p class="s1" style="padding-left: 8pt;text-indent: 0pt;text-align: left;">8688/8071</p></td><td rowspan="3" style="width:161pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p style="text-indent: 0pt;text-align: left;"><br></p><p class="s3" style="padding-left: 2pt;padding-right: 1pt;text-indent: 0pt;line-height: 106%;text-align: center;">BIANCO промышленное двухкомпонентное масло для светлых пород древесины</p><p class="s3" style="text-indent: 0pt;line-height: 9pt;text-align: center;">неколеруемый продукт</p><p class="s3" style="padding-left: 2pt;padding-right: 2pt;text-indent: 0pt;line-height: 106%;text-align: center;">(в прайс-листе указан объем основного компонента А, к каждому объему прилагается компонент В в объеме 1/4 от компонента А)</p></td><td rowspan="3" style="width:293pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p style="text-indent: 0pt;text-align: left;"><br></p><p class="s3" style="padding-left: 1pt;text-indent: 0pt;line-height: 106%;text-align: center;">Однослойное масло BIOFA 8688/8071 BIANCO рекомендовано для защитно-декоративной обработки деревянных поверхностей из светлых пород древесины (дуб, ясень, клён, вяз и прочее) с высокими эксплуатационными требованиями, таких как полы, ступени, столешницы (в том числе для ванных комнат), подоконники, дверные полотна и фурнитура, мебельные фасады, предметы интерьера и прочее в жилых и коммерческих помещениях, а также для обработки пробковых покрытий и плит OSB. Полученная поверхность высыхает через несколько часов, через 12-24 часа может подвергаться нагрузке, а через 48 часов происходит полное отверждение масла. Окрашенная поверхность становится водостойкой и обладает повышенной стойкостью к истиранию по сравнению с обычными маслами. Данный продукт позволяет получить неповторимый декоративный эффект «необработанного дерева». Уникальный комплекс белых пигментов и наполнителей препятствует «поджиганию» древесины и позволяет сохранить её натуральный оттенок.</p></td><td style="width:45pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s3" style="padding-top: 2pt;padding-left: 14pt;text-indent: 0pt;text-align: left;">0,375</p></td><td style="width:58pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s3" style="padding-top: 2pt;text-indent: 0pt;text-align: right;">4 537,00 ₽</p></td><td style="width:47pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s3" style="padding-top: 2pt;padding-left: 20pt;text-indent: 0pt;text-align: left;">15</p></td><td style="width:48pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s3" style="padding-top: 2pt;padding-right: 19pt;text-indent: 0pt;text-align: right;">12</p></td><td style="width:48pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:s