border-right-style:solid;border-right-width:1pt"><p style="text-indent: 0pt;text-align: left;"><br></p><p class="s3" style="padding-left: 2pt;padding-right: 2pt;text-indent: 0pt;line-height: 106%;text-align: center;">Промышленное двухкомпонентное масло для внутренних работ на основе природных компонентов из льняного масла и восков. Не содержит растворителей. Колеруется по каталогу. Полученная поверхность высыхает через несколько часов, через 12-24 часа может подвергаться нагрузке, а через 48 часов происходит полное отверждение масла. Окрашенная поверхность становится водостойкой и обладает повышенной стойкостью к истиранию по сравнению с обычными маслами. Продукт отлично подходит для мебели, паркета, лестниц и других деревянных поверхностей, испытывающих повышенные нагрузки, подчеркивает природный рисунок и текстуру древесины придавая им шелковистый блеск. В прайс-листе указан объем основного компонента А, к каждому объему прилагается компонент В в объеме 1/4 от компонента А.</p></td><td style="width:45pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s3" style="padding-top: 2pt;padding-left: 14pt;text-indent: 0pt;text-align: left;">0,375</p></td><td style="width:58pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s3" style="padding-top: 2pt;text-indent: 0pt;text-align: right;">4 654,00 ₽</p></td><td rowspan="3" colspan="4" style="width:192pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p style="text-indent: 0pt;text-align: left;"><br></p><p class="s3" style="padding-left: 48pt;text-indent: 0pt;text-align: left;">см. техничес